import React from 'react';
import './Sidebar.css';

function Sidebar() {
  return (
    <div className="sidebar">
      <nav>
        <ul className="sidebar-nav">
          <li>Home</li>
          <li>Music</li>
          <li>Gaming</li>
          <li>Education</li>
          <li>Science & Tech</li>
          <li>Entertainment</li>
          <li>Student Hubs</li>
        </ul>
      </nav>
    </div>
  );
}

export default Sidebar;
